import * as React from 'react';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import CircularProgress from '@mui/material/CircularProgress';
import { Container, Typography } from '@mui/material';

export default class ImageWindow extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            images: props.image,
            uploadStatus: props.uploadStatus,
        }
        console.log(props.uploadStatus)
    }
    render(){
        return(
            <Container maxWidth='lg' fixed>
                <Box 
                    width={'100%'}
                    height={450}
                    display="flex" 
                    alignItems="center"
                    justifyContent="center"
                    sx={{backgroundColor: 'secondary.main',
                        borderRadius: 5,
                        border: 2,
                        borderStyle: 'dashed'
                    }}>
                    <CenterItem uploadStatus = {this.state.uploadStatus}/>
                    
                </Box>
            </Container>
        )
    
        // else{
        //     return(
        //         <Grid container spacing={2}>
        //             <Grid item xs={6}>
        //                 <Box sx={{width: 475, height: 400, backgroundColor: 'secondary.main' }} position='relative'>
        //                 </Box>
        //             </Grid>
        //             <Grid item xs={6}>
        //                 <Box sx={{width: 475, height: 400, backgroundColor: 'secondary.main'}} position='relative'></Box>
        //             </Grid>
        //         </Grid>
        //     )
        // }
    }
}


function CenterItem(props){
    if (props.uploadStatus == "not_uploaded"){
        return(
            <Typography>output image preview will be shown here after uploading.</Typography>
        );
    }else if (props.uploadStatus == "processing"){
        return(
            <CircularProgress color="primary" />
        );
    }
}
